import React, { Component } from 'react';
import './Query.css';

class Query extends Component {
    state = {
        keyword:''
    }

    searchKeyword() {
        alert(this.props.location.state.isQuery);
        if (this.props.location.state.isQuery){
            let query = this.props.location.state.query;
            this.setState({
                keyword:query
            })
        } 
    }

    render() {
        if (this.props.location.state.isQuery){
            this.searchKeyword();
        }

        return (
            <div className="query-contatiner">
                Query Page {this.state.keyword}
            </div>
        )
    }
}

export default Query;
